import React, { Component } from "react";
import _ from "lodash";
class ListGroup extends React.Component {
  render() {
    const { genreCount, genreName } = this.props;
    const allGenre = _.compact(genreName);

    return (
      <div>
        <ul className="list-group">
          {allGenre.map((g) => (
            <li className="list-group-item active">{g}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default ListGroup;
